INTERPRET QUERY(
INT variable = 3) FOR GRAPH Transaction_Fraud {
  SumAccum<INT> @size;
  SetAccum<EDGE> @@result;
  tmp = SELECT s 
        FROM Community:s -(Has_Community:e)- Merchant:m
        ACCUM s.@size += 1
        ORDER BY s.@size DESC
        LIMIT variable;
  tmp = SELECT s 
        FROM tmp:s -(Has_Community:e)- Merchant:m
        ACCUM @@result += e;
  PRINT @@result;       
}

